import * as React from "react";

function Login() {
  return (
    <Grid container spacing={2}>
      <Grid xs={8}>
        <div>xs=8</div>
      </Grid>
      <Grid xs={4}>
        <div>xs=4</div>
      </Grid>
      <Grid xs={4}>
        <div>xs=4</div>
      </Grid>
      <Grid xs={8}>
        <div>xs=8</div>
      </Grid>
    </Grid>
  );
}
export default Login;
